import React from 'react'
import './App.css'
import styled from 'styled-components'

const Title = styled.h1`
  color: red;
  font-size: 18px;
`

function App () {
  return(
    <>
      <Title>Titulo bem legal</Title>
    </>
  ) 
}

export default App
